import React from "react";
import Card from "../Card/Card";
import './PokemonList.css'
import img1 from '../../pokemons/1.png';
import img2 from '../../pokemons/2.png';
import img3 from '../../pokemons/3.png';

const PokemonList = (props) => {
    return (
        <div className="container-xl">
            <div className="row">
                <div>
                    {props.store.map(pokemonItem => {
                        return (
                            <div className="col-md-4" key = {pokemonItem.id}>
                                <Card imgsrc={img1} name={pokemonItem.name} id = {pokemonItem.id}/>
                            </div>
                            )
                        }
                    )}
                </div>
                {/* <div className="col-md-4">
                    <Card imgsrc={img1} store={props.store}/>
                </div> */}
            </div>
        </div>



    )
}

export default PokemonList;
